    "Text recognition for your images" : "Rozpoznawanie tekstu dla obrazów",
    "# Description\n\nNextcloud OCR (optical character recognition) processing for images with tesseract-js brings OCR capability to your Nextcloud.\nThe app uses tesseract-js in the browser in order to process images (png, jpeg, tiff, bmp) and saves the output PDF file to the source folder in nextcloud. That for example enables you to search in it.\n\n## Prerequisites, Requirements and Dependencies\nThe OCR app has some prerequisites:\n\n - [Nextcloud 16 and up](https://nextcloud.com/)\n\n - Only supported on latest modern web browsers (Chrome, Edge, Firefox, Opera, Safari*)\n\n - Tesseract traineddata needs about 200 MB space on your server (will be installed automatically).\n\n\n_* On Safari there is currently a problem with the [Content-Security-Policy](https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), that requires an Administrator to set the 'script-src' to 'unsafe-eval' such that the app works properly. Because this is quite insecure the app itself does not set it and recommends to decide that on your own risk (please make sure, that you know what CSP is and what e.g. unsafe-eval causes)._\n\n## Installation\nInstall the app from the [Nextcloud AppStore](https://apps.nextcloud.com/apps/ocr) or download the release package from github (**NOT** the sources) and place the content in **nextcloud/apps/ocr/**.\n\n## Disclaimer\nThe software is distributed on an \"AS IS\" BASIS, WITHOUT WARRANTIES OR\nCONDITIONS OF ANY KIND, either express or implied.\n\n## Note\nThe version 3 and earlier versions are not supported/maintained anymore by the author. So for asynchronous background processing please fork the repository and use the \"not-maintained\" branch to work on improvements. The author wasn't able to support it because of too much effort.\nMoreover this project is based on a webassembly port of tesseract. The maintainer stopped working on PDF processing in this app and will start working on separate app for pdf handling." : "# Opis\n\nKolejne przetwarzanie OCR (optyczne rozpoznawanie znaków) dla obrazów z tesseract-js zapewnia możliwości OCR dla Nextcloud.\nAplikacja używa tesseract-js w przeglądarce do przetwarzania obrazów (png, jpeg, tiff) oraz zapisuje wyjściowy plik PDF w katalogu źródłowym w Nextcloud. Umożliwia to na przykład wyszukiwanie w nim.\n\n## Wymagania wstępne, wymagania i zależności\nAplikacja OCR ma pewne wymagania wstępne:\n\n - [Nextcloud 16 i wyższy] (https://nextcloud.com/)\n\n - Obsługiwane tylko w najnowszych nowoczesnych przeglądarkach internetowych (Chrome, Edge, Firefox, Opera, Safari*)\n\n- Nauczone dane Tesseract potrzebują około 200 MB miejsca na serwerze (zostaną zainstalowane automatycznie).\n\n\n_ * Na Safari występuje obecnie problem z [Content-Security-Policy] (https://developer.mozilla.org/en-US/docs/Web/HTTP/CSP), który wymaga od administratora ustawienia 'script-src' dla 'unsafe-eval', dzięki czemu aplikacja działa poprawnie. Ponieważ jest to dość niepewne, sama aplikacja nie ustawia jej i zaleca podjęcie decyzji na własne ryzyko (upewnij się, że wiesz, czym jest CSP i np. niebezpieczne zdarzenia)._\n\n## Instalacja\nZainstaluj aplikację z [Nextcloud AppStore] (https://apps.nextcloud.com/apps/ocr) lub pobierz pakiet wydania z GitHuba (**NIE** źródła) i umieść zawartość w **nextcloud/apps/ocr/**.\n\n## Zrzeczenie się\nOprogramowanie jest dystrybuowane na zasadzie \"TAK JAK JEST\", BEZ GWARANCJI I\nWARUNKÓW WSZELKIEGO RODZAJU, wyraźnej lub dorozumianej.\n\n## Nota\nWersja 3 i wcześniejsze wersje nie są już wspierane przez autora. Dlatego w przypadku asynchronicznego przetwarzania rozwidlaj repozytorium i użyj gałęzi niewspieranej do pracy nad ulepszeniami. Autor nie był w stanie go wspierać z powodu zbyt dużego wysiłku.\nCo więcej, ten projekt jest oparty na montażu portu sieci Tesseract. Opiekun przestał pracować nad przetwarzaniem plików PDF w tej aplikacji i rozpocznie pracę nad osobną aplikacją do obsługi plików PDF.",
